import React from 'react';
const Header = () => {
    return (
        <div className="App">
            <ul>
                <a href='#s'>Home</a>
                <a href='#s'>News Feed</a>
                <a href='#s'>Messengers</a>
            </ul>
        </div>
    );
}
export default Header;
